import { ClientOnly } from 'components/client-only/client-only';
import React from 'react';
import ApexChart from 'react-apexcharts';

const Charts = ({ ...props }) => {
  return (
    <ClientOnly>
      <ApexChart {...props} />
    </ClientOnly>
  )
};

export default Charts;
